Yesterday was everything I needed to get me through the last few days of 2022! 🙌🏽 We had so much fun talking, laughing, learning new struts, and even a few “pretty” line dances!! 💗💚

@danni_nicole_ & I taught our LSs the “Can’t Get Enough” line dance and now they are ready for @theprettiesthour and all the founders’ day parties! 🫶🏽💕 Danni…I guess we have to take this show on the road! 🤣😉😎 

